import React, { useContext } from "react";

export const CartDetail = (props) => {
  const smartwatchAndQuantity = props;

  return (
    <>
      <article className="item col-3">
        <h3>{smartwatchAndQuantity.smartwatch.itemToShow.title}</h3>
        <h4>${smartwatchAndQuantity.price}</h4>
        <h4>{smartwatchAndQuantity.itemCount}</h4>
        {console.log({ smartwatchAndQuantity })}
      </article>
    </>
  );
};

export default CartDetail;
